import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category to get to a product listing page
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for the category page to load and take screenshot
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Switch to list view mode
    await page.waitForSelector('.view-btn[title="List View"]', { timeout: 5000 });
    await page.click('.view-btn[title="List View"]');

    // Wait for list view to activate and take screenshot
    await page.waitForSelector('.view-btn[title="List View"].active', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify the view mode has changed by checking active button and product layout
    const activeView = await page.$eval('.view-btn.active', el => el.title);
    const productLayout = await page.$eval('.products-list', el => el.className);
    const productCount = await page.$$eval('.product-card-list', elements => elements.length);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        activeViewMode: activeView,
        productLayout: productLayout,
        productsInView: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
